import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route,
} from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Start />} />
      </Routes>
    </BrowserRouter>
  );
}

const Start = () => {
  return (
    <div className='App'>
      <header className='header'>
        <p className='text'>Welcome!</p>
      </header>
      <div className='main'>
        <a href='/123'>Let's Start!</a>
      </div>
    </div>
  )
}

export default App;
